import React from 'react';

import './App.css';
import Header from './components/Header';


const App = () => {
  return (
    <div className="app-wrapper">
        <Header />

      <div className="cont-wrapp">
        <nav className="navigation">
          <div>1</div>
          <div>2</div>
          <div>3</div>
          <div>4</div>
        </nav>

        <div className="cont">
          main content
        </div>
      </div>
    </div>
  )
}

export default App;
